import './App.css';
import { Routes, Route } from 'react-router-dom';
import LoginPage from "./pages/login";

function App() {
  return (
    <Routes>
      <LoginPage/>
      <Route path='/login' element={<LoginPage/>}></Route>
      <Route path='/register'></Route>
    </Routes>
  );
}

export default App;
